import React from 'react';

export default class Capture extends React.Component {
	constructor(props) {
		super(props);
	}

	detect = () => {
  	if (window.BarcodeDetector == undefined) {
    var footer = document.getElementsByTagName('footer')[0];
    footer.innerHTML = "Barcode Detection not supported";
    console.error('Barcode Detection not supported');
    return;
 		}
	}

	render() {
		return (
	<div>
		<button id="detect" onclick={this.detect}  class="btn btn-lg btn-primary">Detect barcodes</button>
		<img hidden id="image" crossorigin='anonymous 'src="https://raw.githubusercontent.com/ihabunek/pdf417-py/master/images/1_basic.jpg"></img> <br/>
		<canvas id="canvas" width="320" height="320"></canvas>
	</div>

		);
	}
}
